demo.repl.help:
ရရှိနိုင်သော command များ:
  @show              ─ နောက်ဆုံး adaptive card အကျဉ်းချုပ်ကို ပြသမည်
  @json              ─ flow မှ လက်ခံရရှိသော raw JSON တန်ဖိုးကို ထုတ်ပြမည်
  @back              ─ ယခင် blocked card/inputs သို့ ပြန်သွားမည်
  @input <k>=<v>     ─ input field တစ်ခုကို သတ်မှတ် သို့မဟုတ် override လုပ်မည်
  @click <action_id> ─ ပေးထားသော action ဖြင့် card ကို submit လုပ်မည်
  @help              ─ ဤအကူအညီစာသားကို ပြမည်
  @quit              ─ REPL မှ ထွက်မည်
